2	Paul Klee	Paul Klee was a Swiss-born German artist. His highly individual style was influenced by movements in art that included expressionism, cubism, and surrealism. Klee was a natural draftsman who experimented with and eventually deeply explored color theory, writing about it extensively; his lectures Writings on Form and Design Theory, published in English as the Paul Klee Notebooks, are held to be as important for modern art as Leonardo da Vinci's A Treatise on Painting was for the Renaissance. He and his colleague, Russian painter Wassily Kandinsky, both taught at the Bauhaus school of art, design and architecture in Germany. His works reflect his dry humor and his sometimes childlike perspective, his personal moods and beliefs, and his musicality.	1879	1940	https://d32dm0rphc51dk.cloudfront.net/VTSBwo2xots6FIJkt9HVvg/four_thirds.jpg	2	1
61	Thomas Rowlandson	Thomas Rowlandson was an English artist and caricaturist of the Georgian Era, noted for his political satire and social observation. A prolific artist and printmaker, Rowlandson produced both individual social and political satires, as well as a large number of illustrations for novels, humorous books, and topographical works. Like other caricaturists of his age such as James Gillray, his caricatures are often robust or bawdy. Rowlandson also produced highly explicit erotica for a private clientele; this was never published publicly at the time and is now only found in a small number of collections. His caricatures included those of people in power such as the Duchess of Devonshire, William Pitt the Younger and Napoleon Bonaparte.	1756	1827	https://d32dm0rphc51dk.cloudfront.net/C1eVXPsJ_SgOB7QZTtb7Dw/four_thirds.jpg	81	1
