346	Julian Alden Weir	Born into an artistic family, Weir was a founding member of the Ten American Painters and became one of the most prominent artists of his generation. His father, Robert Weir (an art instructor at the United States Military Academy), provided his early training, and J. Alden initially began painting in an established academic style, refined by later study in New York and Paris. Unlike many of his peers, Weir enjoyed notable success as a painter and teacher before he ever began to work in an impressionist manner. He concentrated on portraits, figural works, and still lifes, and these works exhibit rigorous structure, dramatic use of dark and light, and bold handling of pigment. \n\nAs Weir became increasingly interested in landscape painting after the purchase of his farm in Branchville, Connecticut (now a National Historic Site), he began to work in a more impressionistic mode, encouraged by his experiments in pastel and watercolor, as well as by his friendships with John Twachtman and Theodore Robinson. Weir gradually adopted the looser brushwork of the impressionist style, altering perspective and flattening forms while choosing to work in a softer color palette than that favored by the more radical practitioners of impressionism. His landscape works include scenes of the western Connecticut hills; Cornish, New Hampshire; the factory landscapes of central Connecticut; and the environs of Cos Cob, Connecticut, where he taught a summer painting class.	1852	1919	https://d32dm0rphc51dk.cloudfront.net/51WlFOIsC0N_idr4zFr7yA/four_thirds.jpg	7	1
363	Joseph Pennell	Joseph Pennell was an American draftsman, etcher, lithographer and illustrator for books and magazines. A prolific artist, he spent most of his working life in Europe, and is known for his interest in landmarks, landscapes and industrial scenes around the world. A student of James Lambdin and Thomas Eakins, he was later influenced by James McNeill Whistler. Married to author Elizabeth Robins, Pennell was a writer in his own right. He published the anti-semitic The Jew at Home: Impressions of a Summer and Autumn Spent with Him (1892), followed by less controversial photo-documentary works including Lithographs of War (1914), Pictures of the Wonders of Work (1915), The Adventures of an Illustrator (1925). In later life, he and wife Elizabeth both wrote art criticism and co-authored books.	1857	1926	https://d32dm0rphc51dk.cloudfront.net/xNz5meooxlAw4W-FE0vYoA/four_thirds.jpg	82	1
380	Félicien Rops	Félicien Victor Joseph Rops was a Belgian artist associated with Symbolism and the Parisian Fin-de Siecle. He was a painter, illustrator, caricaturist and a prolific and innovative print maker, particularly in intaglio. Although not well known to the general public, Rops was greatly respected by his peers and actively pursued and celebrated as an illustrator by the publishers, authors, and poets of his time. He provided frontispieces and illustrations for Jules Barbey d'Aurevilly, Charles Baudelaire, Charles De Coster, Théophile Gautier, Joris-Karl Huysmans, Stéphane Mallarmé, Joséphin Péladan, Paul Verlaine, Voltaire, and many others. Best known today for his prints and drawings illustrating erotic and occult literature of the period, he also produced oil paintings including landscapes, seascapes, and occasional genre paintings. Rops is recognized as a pioneer of Belgian comics.	1833	1898	https://d32dm0rphc51dk.cloudfront.net/UZDtEry5FQWcoBH3-ne_5w/four_thirds.jpg	11	1
398	John Vanderbank	John Vanderbank was a leading English portrait painter who enjoyed a high reputation during the last decade of King George I's reign and remained in high fashion in the first decade of King George II's reign. George Vertue's opinion was that only intemperance and extravagance prevented Vanderbank from being the greatest portraitist of his generation, his lifestyle bringing him into repeated financial difficulties and leading to an early death at the age of only 45.	1694	1739	https://d32dm0rphc51dk.cloudfront.net/0ysG3-Fh5Rpq3RiN1dwVIQ/four_thirds.jpg	1	1
417	George Loring Brown	George Loring Brown  was an American landscape painter. He was born in Boston and first studied wood engraving under Alonzo Hartwell and worked as an illustrator. He studied painting with Washington Allston, but soon went to Europe, residing principally in Italy for years. Brown spent much of his life abroad, and the motives of his pictures are usually Italian, and there is nothing specifically American about them either in treatment or sentiment. Among the best are Sunset in Genoa (1875), Doges' Palace and Grand Canal, Bay of Naples, Niagara Falls in Moonlight. The Bay of New York (1869) was acquired by King Edward VII when visiting America as Prince of Wales.	1814	1889	https://d32dm0rphc51dk.cloudfront.net/zcTD9omG2BhvziRm7Jly8g/four_thirds.jpg	2	1
437	William Holman Hunt	William Holman Hunt was an English painter and one of the founders of the Pre-Raphaelite Brotherhood. His paintings were notable for their great attention to detail, vivid colour, and elaborate symbolism. These features were influenced by the writings of John Ruskin and Thomas Carlyle, according to whom the world itself should be read as a system of visual signs. For Hunt it was the duty of the artist to reveal the correspondence between sign and fact. Of all the members of the Pre-Raphaelite Brotherhood, Hunt remained most true to their ideals throughout his career. He was always keen to maximise the popular appeal and public visibility of his works.	1827	1910	https://d32dm0rphc51dk.cloudfront.net/bez2D6UxUD60KrstVSr9qQ/four_thirds.jpg	2	1
471	Ammi Phillips	Ammi Phillips was a prolific American itinerant portrait painter active from the mid 1810s to the early 1860s in Connecticut, Massachusetts, and New York. His artwork is identified as folk art, primitive art, provincial art, and itinerant art without consensus among scholars, pointing to the enigmatic nature of his work and life. He is attributed to over eight hundred paintings, although only eleven are signed. While his paintings are formulaic in nature, Phillips paintings were under constant construction, evolving as he added or discarded what he found successful, while taking care to add personal details that spoke to the identity of those who hired him. He is most famous for his portraits of children in red, although children only account for ten percent of his entire body of work. The most well known of this series, Girl in Red Dress with Cat and Dog, would be sold for one million dollars, a first for folk art. His paintings hung mostly unidentified, spare for some recognition in the collections like those of Edward Duff Balken, for decades until his oeuvre was reconstructed by Barbara Holdridge and Larry Holdridge, collectors and students of American folk art, with the support of the art historian Mary Black. Ammi Phillip's body of work was expanded upon their discovery that the mysterious paintings of a "Kent Limner" and "Border Limner" were indeed his.	1788	1865	https://d32dm0rphc51dk.cloudfront.net/4JUK6idXaJ-ICejprbLxhQ/four_thirds.jpg	3	1
481	Hendrick Avercamp	Hendrick Avercamp was a Dutch painter during the Dutch Golden Age of painting. He was one of the earliest landscape painters of the 17th-century Dutch school, he specialized in painting the Netherlands in winter. His paintings are colorful and lively, with carefully crafted images of the people in the landscape. His works give a vivid depiction of sport and leisure in the Netherlands in the beginning of the 17th century. Many of Avercamp's paintings feature people ice skating on frozen lakes.	1585	1634	https://d32dm0rphc51dk.cloudfront.net/qFikE6bK1o2GybUQmfOJoA/four_thirds.jpg	5	1
530	Richard Parkes Bonington	Richard Parkes Bonington was an English Romantic landscape painter, who moved to France at the age of 14 and can also be considered as a French artist, and an intermediary bringing aspects of English style to France. Becoming, after his early death, one of the most influential British artists of his time, the facility of his style was inspired by the old masters, yet was entirely modern in its application. His landscapes were mostly of coastal scenes, with a low horizon and large sky, showing a brilliant handling of light and atmosphere. He also painted small historical cabinet paintings in a freely-handled version of the troubadour style.	1802	1828	https://d32dm0rphc51dk.cloudfront.net/7AOa7Ea-7sEIL0zQkarplw/four_thirds.jpg	8	1
