568	Francesco Zuccarelli	Giacomo Francesco Zuccarelli RA, was an Italian artist of the late Baroque or Rococo period. He is considered to be the most important landscape painter to have emerged from his adopted city of Venice during the mid-eighteenth century, and his Arcadian views became popular throughout Europe and especially in England where he resided for two extended periods. His patronage extended to the nobility, and he often collaborated with other artists such as Antonio Visentini and Bernardo Bellotto. In 1768, Zuccarelli became a founding member of the Royal Academy of Arts, and upon his final return to Italy, he was elected president of the Venetian Academy. In addition to his rural landscapes which frequently incorporated religious and classical themes, Zuccarelli created devotional pieces and on occasion did portraiture. Beside paintings, his varied output included etchings, drawings, and designs for tapestries as well as a set of Old Testament playing cards.	1702	1788	https://d32dm0rphc51dk.cloudfront.net/qjEnRnN8JOcsxnb4eps6zw/four_thirds.jpg	3	1
583	Francis Frith	Francis Frith was an English photographer of the Middle East and many towns in the United Kingdom.\nFrith was born in Chesterfield, Derbyshire, attending Quaker schools at Ackworth and Quaker Camp Hill in Birmingham, before he started in the cutlery business. He suffered a nervous breakdown in 1843, recuperating over the next two years. In 1850 he started a photographic studio in Liverpool, known as Frith & Hayward. A successful grocer, and later, printer, Frith fostered an interest in photography, becoming a founding member of the Liverpool Photographic Society in 1853. Frith sold his companies in 1855 in order to dedicate himself entirely to photography. He journeyed to the Middle East on three occasions, the first of which was a trip to Egypt in 1856 with very large cameras. He used the collodion process, a major technical achievement in hot and dusty conditions.	1822	1898	https://d32dm0rphc51dk.cloudfront.net/l6dCNyS-uM9KJy1GbKsvXg/four_thirds.jpg	3	1
612	Marco Dente	Marco Dente da Ravenna (1493–1527), usually just called Marco Dente, was an Italian engraver born in Ravenna in the latter part of the 15th Century. He was a prominent figure within the circle of printmakers around Marcantonio Raimondi in Rome, and is known for the imitative nature of the reproductive prints or close copies of other prints that were most of his output. His prints in specific cases are also of certain interest in that we can see the impact and design of sculptural restorations. Marco Dente was killed in the tumult of the Sack of Rome in 1527. He used the accompanying monogram, D-B; albeit sparingly.	1493	1527	https://d32dm0rphc51dk.cloudfront.net/jTqivUx_mKB8m8oiXJGQQg/four_thirds.jpg	2	1
