646	Sir James Thornhill	Sir James Thornhill was an English painter of historical subjects working in the Italian baroque tradition. He was responsible for some large-scale schemes of murals, including the "Painted Hall" at the Royal Hospital, Greenwich, the paintings on the inside of the dome of St Paul's Cathedral, and works at Chatsworth House and Wimpole Hall.	1675	1734	https://d32dm0rphc51dk.cloudfront.net/Lm36s069hpTCOI7QOdm8vQ/four_thirds.jpg	1	1
651	Joseph Badger	Joseph Badger was a portrait artist in Boston, Massachusetts, in the 18th century. He was born in Charlestown, Massachusetts, to tailor Stephen Badger and Mercy Kettell. He "began his career as a house-painter and glazier, and ... throughout his life continued this work, besides painting signs, hatchments and other heraldic devices, in order to eke out a livelihood when orders for portraits slackened." In 1731 he married Katharine Felch; they moved to Boston around 1733. He was a member of the Brattle Street Church. He died in Boston on May 11, 1765, when "on Saturday last one Mr. Badger, of this Town, Painter, was taken with an Apoplectic Fit as he was walking in his Garden, and expired in a few Minutes after." Works by Badger are in the collections of the Worcester Art Museum, the Museum of Fine Arts Boston, and Historic New England's Phillips House, Salem, Mass. While respected in his own time, subsequent scholars and connoisseurs largely overlooked Badger's significance until Lawrence Park wrote a book about him in 1918.	1708	1765	https://d32dm0rphc51dk.cloudfront.net/IEzMbKlEK88wyoLOB2WbwQ/four_thirds.jpg	2	1
684	William Daniell	William Daniell (1769–1837) was an English landscape and marine painter, and printmaker, notable for his work in aquatint. He travelled extensively in India in the company of his uncle Thomas Daniell, with whom he collaborated on one of the finest illustrated works of the period – Oriental Scenery. He later travelled around the coastline of Britain to paint watercolours for the equally ambitious book A Voyage Round Great Britain. His work was exhibited at the Royal Academy and the British Institution and he became a Royal Academician in 1822.	1769	1837	https://d32dm0rphc51dk.cloudfront.net/KxqmleswvBfJ2aWVs9Z-iA/four_thirds.jpg	1	1
